CREATE TABLE "agenda_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(60) NOT NULL, "description" text NULL, "create_date" datetime NOT NULL, "start_datetime" datetime NOT NULL, "end_datetime" datetime NULL, "old_ev_id" varchar(8) NULL, "old_rr_id" varchar(8) NULL, "old_rs_id" varchar(8) NULL, "exception_date" date NULL, "canceled" bool NOT NULL, "recurrence_periodicity" integer unsigned NULL, "recurrence_week_day" integer unsigned NOT NULL, "recurrence_week_offset" integer unsigned NOT NULL, "recurrence_week_period" integer unsigned NULL, "recurrence_week_rank" integer NULL, "recurrence_week_parity" integer unsigned NULL, "recurrence_end_date" date NULL, "creator_id" integer NULL REFERENCES "auth_user" ("id"), "event_type_id" integer NOT NULL REFERENCES "agenda_eventtype" ("id"), "exception_to_id" integer NULL REFERENCES "agenda_event" ("id"), "ressource_id" integer NULL REFERENCES "ressources_ressource" ("id"), UNIQUE ("exception_to_id", "exception_date"));
